import React, { useState } from 'react';
import '../css/login.css'; 

const Login = ({ goToPresentation }) => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aquí puedes manejar la lógica para enviar los datos del formulario
    console.log('Correo electrónico:', email);
    console.log('Contraseña:', password);
    // También puedes enviar los datos a un servidor o realizar otras acciones
  };

  return (
    <div>
      <div className='Title'>
        <h1>Alliance</h1>
      </div>

      <div className='Body'>
        <div className='Inicio'><h1>Iniciar Sesión</h1></div>
        <form onSubmit={handleSubmit}>
          <div className='email'>
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
            />
          </div>
          <div>
            <label htmlFor="password">Contraseña <img src="../public/img/candado.png" alt="" /></label> 
            <input
              type="password"
              id="password"
              value={password}
              onChange={handlePasswordChange}
              required
            />
          </div>
        </form>
        <div className='ButtonAcces'><button type="submit" className='InitSes'>Iniciar Sesión</button></div>
        
      </div>
      <div className='Access'><h2>¿Olvidaste la contraceña?</h2>
      <div className='ButtonAcces'><button onClick={goToPresentation} className='InitAccess' >¿Primera vez en Alliance? Accede ahora</button></div>
      </div>
    </div>
  );
}

export default Login;
